          agp95[i] = GlucoseUtils.mgdlToMmol(AGPUtils.calculateYValue(momentMap.get(moment)).p95);
        }
        xData[i] = moment;
        if (i == 0) {
          avgMap.set(moment, momentMap.get(moment));
        }
        if (i % 60 == 0) {
          avgMoment = i / 60;
          x2Data[i / 60] = moment;
          avgMap.set(avgMoment, momentMap.get(moment) ? momentMap.get(moment) : 0);
          console.log(avgMap);
        } else {
          avgMap.get(avgMoment).push(momentMap.get(moment) ? momentMap.get(moment) : 0);
